import os
import uuid
import mimetypes
import asyncio
from google import genai
from google.genai import types
from django.core.files.base import ContentFile
from core.utils.constants import (
    MENU_ITEM_IMAGE_GENRATION_PROMPT,
    IMAGE_GEN_MODEL_GEMINI,
    DESCRIPTION_ENHANCEMENT_MODEL_GEMINI,
    MENU_ITEM_DESCRIPTION_ENHANCEMENT_SYSTEM_PROMPT,
    GEMINI_EMBEDDINGS_MODEL,
    MENUITEM_COLLECTION_NAME,
    MENU_CATEGORY_IMAGE_GENRATION_PROMPT
)
from anyio import to_thread  # Use anyio for FastAPI compatibility
from dishto.GlobalUtils import genai_client, qdrant_client_
from qdrant_client.models import PointStruct, Filter, FieldCondition, MatchValue
from langchain_text_splitters import RecursiveCharacterTextSplitter
import base64

GEMINI_IMAGE_SEMAPHORE = asyncio.Semaphore(9)

GEMINI_DESCRIPTION_SEMAPHORE = asyncio.Semaphore(29)

menu_item_description_splitter = RecursiveCharacterTextSplitter(
        chunk_size=150,
        chunk_overlap=30,
        length_function=len,
)

def _blocking_gemini_image(
    food_name: str, description: str, prompt: str, model: str, generate_content_config
) -> ContentFile:
    client = genai.Client(api_key=os.environ.get("GEMINI_API_KEY"))
    contents = [
        types.Content(role="user", parts=[types.Part.from_text(text=prompt)]),
        types.Content(
            role="model",
            parts=[
                types.Part.from_bytes(
                    mime_type="image/png",
                    data=base64.b64decode(
                        """"""
                    ),
                ),
                types.Part.from_text(
                    text=f"""Generate a hyper-realistic, studio-quality product advertisement photograph for a fictional luxury Food name is - {food_name}, Food Description is - {description}. The food should appear fresh, indulgent, and visually mouth-watering  showcasing rich textures, vibrant colors, and natural steam, crispness, or moisture depending on the nature of the dish. The presentation should be elegant and upscale, styled on a premium surface such as dark slate, polished marble, or rustic wood. Include subtle elements like garnishes, herbs, or sauces to enhance realism and appeal. The image must include the \"dishto\" logo in clean, minimalist white text, positioned in the top-left corner only. The logo must not be altered in any way  no changes to color, font, size ratio, or styling. It should be clearly visible but not overpowering, maintaining the premium and refined aesthetic of the overall composition. Use dramatic, high-contrast lighting with a rim light from behind and the side to highlight the textures, contours, and freshness of the food. The background should be dark and moody, with a soft ambient glow evoking a premium dining atmosphere. The final render must be extremely photorealistic, as if shot on a professional DSLR with a macro lens, capturing every detail that conveys luxury, craftsmanship, and irresistible flavor. The image must be rendered in a 1:1 (square) aspect ratio."""
                )
            ],
        )
    ]
    for chunk in client.models.generate_content_stream(
        model=model,
        contents=contents,
        config=generate_content_config,
    ):
        if (
            chunk.candidates
            and chunk.candidates[0].content
            and chunk.candidates[0].content.parts
            and chunk.candidates[0].content.parts[0].inline_data
            and chunk.candidates[0].content.parts[0].inline_data.data
        ):
            inline_data = chunk.candidates[0].content.parts[0].inline_data
            data_buffer = inline_data.data
            file_extension = mimetypes.guess_extension(inline_data.mime_type) or ".jpg"
            file_name = f"{food_name}_{uuid.uuid4().hex}{file_extension}"
            return ContentFile(data_buffer, name=file_name)
    raise RuntimeError("No image data returned from Gemini.")


async def generate_menu_item_image(
    food_name: str, description: str, max_retries: int = 3, delay: float = 2.0
) -> ContentFile:
    """
    Generates a photorealistic menu item image using Gemini and returns a Django ContentFile.
    Runs the blocking Gemini call in a thread to avoid blocking the event loop.
    Retries on failure.
    """
    model = IMAGE_GEN_MODEL_GEMINI
    prompt = MENU_ITEM_IMAGE_GENRATION_PROMPT
    generate_content_config = types.GenerateContentConfig(
        temperature=2,
        top_p=1,
        response_modalities=["IMAGE", "TEXT"],
        response_mime_type="text/plain",
    )

    last_exception = None
    async with GEMINI_IMAGE_SEMAPHORE:
        for attempt in range(1, max_retries + 1):
            try:
                result = await to_thread.run_sync(
                    _blocking_gemini_image,
                    description,
                    food_name,
                    prompt,
                    model,
                    generate_content_config,
                )
                return result
            except Exception as e:
                last_exception = e
                print(f"[Gemini] Attempt {attempt} failed: {e}")
            if attempt < max_retries:
                await asyncio.sleep(delay)
    raise RuntimeError(
        f"Failed to generate image from Gemini after {max_retries} attempts. Last error: {last_exception}"
    )


def _blocking_gemini_enhance_description(client, model, contents, config):
    response = client.models.generate_content(
        model=model, contents=contents, config=config
    )
    return response.text


async def enhance_menu_item_description_with_ai(
    item_name: str, description: str, max_retries: int = 3, delay: float = 2.0
) -> str:
    """
    Enhances a menu item description using Gemini AI.
    Returns a vivid, appetizing, and concise description for menu/app use.
    Runs the blocking Gemini call in a thread to avoid blocking the event loop.
    Retries on failure.
    """
    model = DESCRIPTION_ENHANCEMENT_MODEL_GEMINI
    prompt = f"Food Item: {item_name}, Food Description: {description}"

    contents = [
        types.Content(role="user", parts=[types.Part.from_text(text=prompt)]),
    ]
    config = types.GenerateContentConfig(
        system_instruction=MENU_ITEM_DESCRIPTION_ENHANCEMENT_SYSTEM_PROMPT,
        temperature=1,
    )

    last_exception = None
    async with GEMINI_DESCRIPTION_SEMAPHORE:
        for attempt in range(1, max_retries + 1):
            try:
                response_text = await to_thread.run_sync(
                    _blocking_gemini_enhance_description,
                    genai_client,
                    model,
                    contents,
                    config,
                )
                return response_text
            except Exception as e:
                last_exception = e
                print(f"[Gemini] Description enhancement attempt {attempt} failed: {e}")
                if attempt < max_retries:
                    await asyncio.sleep(delay)
    raise RuntimeError(
        f"Failed to enhance description from Gemini after {max_retries} attempts. Last error: {last_exception}"
    )


async def generate_embeddings(
    contents: list[str], model: str = GEMINI_EMBEDDINGS_MODEL
) -> list[float]:
    """
    Generates embeddings for the given contents using the specified model.
    Returns a list of embeddings.
    """
    response = genai_client.models.embed_content(model=model, contents=contents)

    if not response.embeddings:
        raise ValueError("No embeddings returned from Gemini.")

    return [embedding.values for embedding in response.embeddings]


async def return_matching_menu_items(
    query: str, outlet_slug: str, limit: int = 10, threshold: float = 0.7
) -> list[dict]:
    """Returns a list of matching menu items based on the query and outlet slug.
    Uses the Qdrant vector database to find similar items.
    """
    # Generate the query embedding
    query_embedding = await generate_embeddings([query])

    search_results = qdrant_client_.query_points(
        collection_name=MENUITEM_COLLECTION_NAME,
        query=query_embedding[0],
        limit=limit,
        query_filter=Filter(
            must=[
                FieldCondition(
                    key="outlet_slug", match=MatchValue(value=outlet_slug)
                ),
            ]
        ),
        with_payload=True,
    )
    return [point.payload for point in search_results.points]

async def return_embeddings_given_chunks(
    chunks: list[str], model: str = GEMINI_EMBEDDINGS_MODEL
) -> list[list[float]]:
    """
    Generates embeddings for a list of text chunks using the specified model.
    Returns a list of embeddings, one for each chunk.
    """
    if not chunks:
        return []

    # Generate embeddings for all chunks
    embeddings = await generate_embeddings(chunks, model=model)
    
    return embeddings

async def generate_menu_item_embedding(
    name: str, description: str, slug: str, outlet_slug: str
) -> None:
    # New approach will use multiple embedding chunks for this
    chunks = menu_item_description_splitter.split_text(description)

    embeddings = await return_embeddings_given_chunks(chunks)
    if not embeddings:return
    points = []
    for i, embedding in enumerate(embeddings):
        point_id = str(uuid.uuid5(uuid.NAMESPACE_DNS, f"{slug}_{i}"))
        point = PointStruct(
            id=point_id,
            vector=embedding,
            payload={"slug": slug, "outlet_slug": outlet_slug}
        )
        points.append(point)
    # insert it into qdrant
    qdrant_client_.upsert(collection_name=MENUITEM_COLLECTION_NAME, points=points)


async def generate_menu_category_image(
    category_name: str, max_retries: int = 3, delay: float = 2.0
) -> ContentFile:
    """
    Generates a photorealistic menu category image using Gemini and returns a Django ContentFile.
    Runs the blocking Gemini call in a thread to avoid blocking the event loop.
    Retries on failure.
    """
    prompt = MENU_CATEGORY_IMAGE_GENRATION_PROMPT.format(category_name=category_name)
    
    model = IMAGE_GEN_MODEL_GEMINI
    generate_content_config = types.GenerateContentConfig(
        temperature=2,
        top_p=1,
        response_modalities=["IMAGE", "TEXT"],
        response_mime_type="text/plain",
    )

    last_exception = None
    async with GEMINI_IMAGE_SEMAPHORE:
        for attempt in range(1, max_retries + 1):
            try:
                result = await to_thread.run_sync(
                    _blocking_gemini_image,
                    category_name,
                    category_name,
                    prompt,
                    model,
                    generate_content_config,
                )
                return result
            except Exception as e:
                last_exception = e
                print(f"[Gemini] Category image attempt {attempt} failed: {e}")
            if attempt < max_retries:
                await asyncio.sleep(delay)
    raise RuntimeError(
        f"Failed to generate category image from Gemini after {max_retries} attempts. Last error: {last_exception}"
    )
